  false,\n\t\"url\": null,\n\t\"notes\": \"This Light Detection and Ranging (LiDAR)
  LAS dataset is a survey of inland Okaloosa County, Florida not covered in the 2008
  Florida Department of Emergency Management LiDAR initiative. The project area consists
  of approximately 874 square miles, including a buffer of approximately 50 feet along
  the edges of the project. The project design of the LiDAR data acquisition was developed
  to support a nominal post spacing of 4.9 feet or 1.5 meters for un-obscured areas.
  Fugro EarthData, Inc. acquired 49 flight lines in three lifts on February 10, 2008.
  The data was divided into 5000' by 5000' foot cells that serve as the tiling scheme.
  LiDAR data collection was performed with a Cessna 310 aircraft, utilizing a Leica
  ALS50-II MPiA sensor, collecting multiple return x, y, and z data as well as intensity
  data. LiDAR data was processed to achieve a bare ground surface. LIDAR data is remotely
  sensed high-resolution elevation data collected by an airborne collection platform.
  Using a combination of laser range finding, GPS positioning and inertial measurement
  technologies, LIDAR instruments are able to make highly detailed Digital Elevation
  Models (DEMs) of the earth's terrain, man-made structures and vegetation. This data
  of inland Okaloosa County, Florida, was collected at sufficient resolution to provide
  a nominal point spacing of 1.5m for collected points. Up to 5 returns were recorded
  for each pulse in addition to an intensity value.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
